package pearson;

import org.junit.Assert;
import org.junit.Before;
import org.junit.FixMethodOrder;
import org.junit.Test;
import org.junit.runners.MethodSorters;

@FixMethodOrder(MethodSorters.NAME_ASCENDING)
public class AnagramDetectionTest {
  
  private AnagramDetection anagramDetection;

  @Before
  public void setUp() throws Exception {
    anagramDetection = new AnagramDetection();
  }

  @Test
  public void testA() {
    String queryString = "dAn";
    String parentString = "AdnBndAndBdaBnAdn";
    Assert.assertEquals(6,anagramDetection.findAnagramCount(queryString, parentString));
  }
  
  @Test
  public void testB() {
    String queryString = "dAn";
    String parentString = "";
    Assert.assertEquals(6479,anagramDetection.findAnagramCount(queryString, parentString));
  }

}
